INSERT INTO `page_translations` VALUES (1,3,'en','About PGecom','PGecom is an online course marketplace with a pile of features that helps you to run your online education business easily.','<div><b>PGecom</b> is an online course marketplace with a pile of features that helps you to run your online education business easily. This platform helps instructors and students get in touch together and share knowledge.</div><div><br></div><div>Teachers will be able to create unlimited video courses, live classes, text courses, projects, quizzes, files, etc and students will be able to use the educational material and increase their skill level.</div><div><br></div><div>Rocket LMS is based on real business needs, cultural differences, advanced user researches so it covers your business requirements efficiently.</div><div style=\"text-align: center; \"><br></div><div><br></div><div><b>WHY CHOOSE PGecom?</b></div><div><br></div><div>- Comprehensive solution for online education businesses</div><div>- Based on real business needs</div><div>- Multiple content types (Video courses, Live classes, text courses)</div><div>- Youtube, Vimeo, and AWS integration</div><div>- Google calendar integration</div><div>- Online 1 to 1 meetings support</div><div>- Single &amp; multiple instructors</div><div>- Organizational education system</div><div>- Subscribe system</div><div>- Various payment gateways for worldwide</div><div>- Offline payment</div><div>- Multilanguage</div><div>- Fully responsive</div><div>- Fully customizable</div><div>- RTL support</div>'),(2,5,'en','Terms of Service','Our mission is to improve lives through learning. We enable anyone anywhere to create and share educational content (instructors) and to access that educational content to learn.','<p><b>Note: This is just demo data.</b></p><p>Our mission is to improve lives through learning. We enable anyone anywhere to create and share educational content (instructors) and to access that educational content to learn (students). We consider our marketplace model the best way to offer valuable educational content to our users. We need rules to keep our platform and services safe for you, us, and our student and instructor community. These Terms apply to all your activities on the Udemy website, the Udemy mobile applications, our TV applications, our APIs, and other related services (“<b>Services</b>”).</p><p>If you publish content on our platform, you must also agree to the Instructor Terms. We also provide details regarding our processing of the personal data of our students and instructors in our Privacy Policy. If you are using our platform for Business as part of your organization’s Udemy for Business subscription, you should consult our Udemy for Business Privacy Statement.</p><p style=\"text-align: center; \"><img src=\"/assets/store/1/default_images/blogs/home2.png\" style=\"width: 954px;\"><br></p><p>You need an account for most activities on our platform, including to <b>purchase</b> and access content or to <b>submit content for publication</b>. When setting up and maintaining your account, you must provide and continue to provide accurate and complete information, including a valid email address. You have complete responsibility for your account and everything that happens on your account, including for any harm or damage (to us or anyone else) caused by someone using your account without your permission. This means you need to be careful with your password. You may not transfer your account to someone else or use someone else’s account. If you contact us to request access to an account, we will not grant you such access unless you can provide us with the information that we need to prove you are the owner of that account. In the event of the death of a user, the account of that user will be closed.</p>'),(3,3,'ht','Apwopo PGecom','Protege Global Ecommerce, se yon mache kou sou entènèt ak yon pil nan karakteristik ki ede w dirije biznis edikasyon sou entènèt ou fasil.','<p>Protege Global Ecommerce se yon mache kou sou entènèt ak yon pil nan karakteristik ki ede w dirije biznis edikasyon sou entènèt ou fasil. Platfòm sa a ede enstriktè ak elèv yo pran kontak ansanm epi pataje konesans.</p><p>Pwofesè yo pral kapab kreye kou videyo san limit, klas an dirèk, kou tèks, pwojè, egzamen, dosye, elatriye epi elèv yo pral kapab itilize materyèl edikasyonèl la epi ogmante nivo konpetans yo.</p><p>PGecom baze sou bezwen biznis reyèl, diferans kiltirèl, rechèch itilizatè avanse pou li kouvri kondisyon biznis ou avèk efikasite.</p><p><br></p><p>POUKISA CHWAZI PGecom?</p><p>- Solisyon konplè pou biznis edikasyon sou entènèt</p><p>- Ki baze sou bezwen biznis reyèl</p><p>- Plizyè kalite kontni (kou videyo, kou an dirèk, kou tèks)</p><p>- Youtube, Vimeo, ak entegrasyon AWS</p><p>- Google kalandriye entegrasyon</p><p>- Sou entènèt 1 a 1 reyinyon sipò</p><p>- Selibatè ak plizyè enstriktè</p><p>- Sistèm edikasyon òganizasyonèl</p><p>- Abònman sistèm</p><p>- Divès pòtay peman pou atravè lemond</p><p>- Offline peman</p><p>- Plizyè lang</p><p>- Totalman reponn</p><p>- Konplètman personnalisable</p><p>- RTL sipò</p>');
