INSERT INTO `webinar_translations` VALUES (50,2021,'fr','Kòmanse Biznis ou anliy avèk Shopify',NULL,'<p>Kòmanse Biznis ou anliy avèk Shopify<br></p>'),(51,2022,'fr','Dropship with CJ Dropshipping',NULL,'<p><span style=\"color: rgb(31, 41, 73); font-family: &quot;Open Sans&quot;;\">Start a business or grow an existing one with Shopify, Source &amp; fulfill with high-quality products and faster shipping, and Sell trending products with no inventory</span><br></p><div><br></div>'),(52,2023,'fr','Facebook Ads','Facebook Ads','<p>Launch a Facebook Ads Campaign, Analyze Facebook Ads Data, and Learn how to do retargeting<br></p>'),(61,2031,'fr','PINTEREST PUB 5.0',NULL,'<p>Ce que vous allez apprendre .</p><p><br></p><p>? Guide complet, 2022, étape par étape pour déclencher un raz-de-marée de trafic et de ventes RAPIDEMENT, SANS AUCUNE expérience en marketing (ou même site web) !</p><p><br></p><p>? Pinterest SEO - construire une machine qui peut atteindre des MILLIERS de vos clients de rêve & les faire acheter pendant que vous dormez.</p><p><br></p><p>? Guide étape par étape pour créer des graphiques Pinterest époustouflants QUI OBTIENNENT DES RÉSULTATS en quelques minutes (gratuitement) sans aucune expérience de conception.</p><p><br></p><p>? 2 campagnes publicitaires Pinterest simples & INSTAMMENT  PROFITABLES que pratiquement TOUTES les entreprises peuvent mettre en œuvre dès aujourd\'hui !</p><p><br></p><p>?️ Aimez-le ou récupérez 100 % de votre argent, c\'est garanti ! Inscrivez-vous maintenant avant que cette offre ne prenne fin.</p><p><br></p><p>? Lisez les esprits de votre public cible pour savoir EXACTEMENT quels produits et contenus ils veulent désespérément, comment les leur donner et en tirer profit.</p><p><br></p><p>⏳ Économisez des HEURES de temps et de stress en identifiant rapidement et en tuant les mauvaises stratégies avec Pinterest Analytics.</p><p><br></p><p>? La publicité sur Pinterest simplifiée - guide complet étape par étape.</p>'),(63,2033,'fr','Dropshipping Master Class 2.0 Official','Dropshipping Master Class 2.0 Official','<p>This is the latest course of Dropshipping Master Class in 2022. We hope that you enjoy this course as much as we like creating it. </p>'),(65,2033,'en','Dropshipping Master Class 2.0 Official','Dropshipping Master Class 2.0 Official','<p>This is the latest course of Dropshipping Master Class in 2022. We hope that you enjoy these courses as much as we like creating them. <br></p>'),(71,2038,'en','AMAZON FBA ONLINE AND RETAIL ARBITRAGE ACADEMY',NULL,'<p>Bati yon amazon bisnis pandan ke ou chita lakay ou san ke ou pa bezwen kraze tet ou si ou ta renmen fe sikse nan klas sa ou pral aprann tout sa ki ta ede ou grandi sou amazon nan pwop lang ou.</p><p> </p>'),(72,2039,'en','Facebook Ads Seminar - 30th July - 1 August 2021','Facebook Ads Seminar - 30th July - 1 August 2021','<p>Facebook Ads Seminar - 30th July - 1 August 2021<br></p>'),(73,2040,'en','Advanced Python for datascience',NULL,'<p>.<br></p>'),(74,2041,'en','Facebook Ads Seminar','Koman pou\'w fè Facebook Ads pou\'w jwenn kliyan','<p>Facebook Ads Seminar<br></p>'),(75,2042,'en','Snapchat Master Class',NULL,'<p>Klas sa dedye a tout moun ki ta renmen apwann byen metrize snapchat ad pou devlope mak yo sou intènèt la oubyen pou vann sèvis yo a nenpòt antrepriz ki ta bezwen kreye piblisite sou snapchat.<br></p>'),(76,2043,'en','Droshipping Master Klas 2021',NULL,'<p>Byenvini nan fason dropshipping ecomremao a, anndan fòmasyon sa nou pataje ak ou tout dènye metòd pouw kapab reyisi nan biznis anliy plis yon akonpayman asire kap edew reyisi pi rapid.<br></p>'),(77,2023,'en','Facebook Ads','Facebook Ads','<p>Aprann tout sa\'w dwe konnen de Facebook Ads. </p>'),(81,2046,'en','Facebook Ads En ABC','Anpil Moun Gen Gwo Problem sitou nan koze maketin pou biznis yo, Anpil Lot Ap Plenyen Paske Biznis Yo pa ka mache akoz Facebook Bloke Piblisite yo Oubyen Kont Manadjè Yo.  Ebyen Jodia Shopify An Kreyol Pote Solisyon Pou Ou Avek Kou \" FACEBOOK ADS EN ABC \"  Kisa wap jwenn nan kou sa?  Nan kou facebook ads en abc a, nou pwan swen pou explike\'w kisa facebook la ye, poukisa ou oblije itilize facebook, koman pou evite facebook bloke biznis manadjè ou, koman pou kreye yon kont biznis manadjè, koman pou verifye kont lan, Tout kalite tip de ads ke ou ka fè, Ak anpil lot bagay toujou.     Facebook Ads En ABC Se solisyon e se kle ki pou demare biznis ou an.  Avantaj ke\'w genyen menm siw pa gen biznis nou montrew koman\'w kapab fè lajan ak facebook ads antanke yon ajans maketin.','<p>Anpil Moun Gen Gwo Problem sitou nan koze maketin pou biznis yo, Anpil Lot Ap Plenyen Paske Biznis Yo pa ka mache akoz Facebook Bloke Piblisite yo Oubyen Kont Manadjè Yo.</p><p>Ebyen Jodia Shopify An Kreyol Pote Solisyon Pou Ou Avek Kou <strong>\" FACEBOOK ADS EN ABC \"</strong></p><p><strong>Kisa wap jwenn nan kou sa?</strong></p><p>Nan kou <strong>facebook ads en abc</strong> a, nou pwan swen pou explike\'w <strong>kisa facebook la ye</strong>, <strong>poukisa ou oblije itilize facebook, koman pou evite facebook bloke biznis manadjè ou, koman pou kreye yon kont biznis manadjè, koman pou verifye kont lan</strong>, Tout kalite tip de ads ke ou ka fè, Ak anpil lot bagay toujou.</p><p> </p><p><strong>Facebook Ads En ABC</strong> Se solisyon e se kle ki pou demare biznis ou an.</p><p>Avantaj ke\'w genyen menm siw pa gen biznis nou montrew koman\'w kapab fè lajan ak facebook ads antanke yon ajans maketin.</p>'),(83,2048,'en','PINTEREST PUBLICITE GUIDE 1.1',NULL,'<p><b>Kisa mwen pral Aprann ?</b></p><p><b><br></b></p><p>Class Live sa ap bay ou Posibilite pou w fe konesans ak yon Platfòm ki rele Pinterest , ki yonn nan gwo Poto mitan depi kek ane, nan sak rele Marketing pou anpil gwo Konpayi, Ajans, Biznis fizik tankou Biznis Anliy. Se yonn nan platfòm ki bay posibilite pou w fe kalite bagay ke Facebook ak Google pa bay chans fè.</p><p><br></p><p> </p><p><b>Pou kiyes CLASS LIVE sa ye ?</b></p><p>☑️-Antreprenè, </p><p>☑️-Ajans Marketing</p><p>