 oubyen pou vann sèvis yo a nenpòt antrepriz ki ta bezwen kreye piblisite sou snapchat.</p>'),(94,2033,'ht','Dropshipping Master Class 2.0 Official',NULL,'<p>This is the latest course of Dropshipping Master Class in 20222. We hope that you enjoy this courses as much as we like creating it.&nbsp;</p>'),(95,2021,'ht','Kòmanse Biznis ou anliy avèk Shopify','Kòmanse Biznis ou anliy avèk Shopify','<h3 class=\"font-16 text-dark-blue font-weight-bold\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; line-height: 1.5; padding: 0px; color: rgb(23, 19, 71); outline: none !important;\"><span style=\"font-weight: normal;\">Kòmanse Biznis ou anliy avèk Shopify</span></h3>'),(97,2048,'ht','PINTEREST PUBLICITE GUIDE 1.1','PINTEREST PUBLICITE GUIDE 1.1','<p>PINTEREST PUBLICITE GUIDE 1.1<br></p>'),(98,2050,'en','Website Design',NULL,'<div id=\"comp-ku578eh4\" class=\"_1Q9if\" data-testid=\"richTextElement\" data-angle=\"0\" data-angle-style-location=\"style\" data-screen-in-hide=\"done\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 10px; background: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; pointer-events: none; overflow-wrap: break-word; min-height: var(--min-height); position: relative; left: 0px; grid-area: 1 / 1 / 2 / 2; place-self: start; width: 282px; height: auto; visibility: inherit;\"><h2 class=\"font_2\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; line-height: 1.1em; font-size: 33px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; pointer-events: auto;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; letter-spacing: 0em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-family: wfont_72786f_c0efe2d1941243b59373e64387bb5b0b, wf_c0efe2d1941243b59373e6438, orig_object_sans_heavy;\"><font color=\"#000000\">Web-Designer</font></span></span></span></span></h2></div><div id=\"comp-ku578xzd\" class=\"_1Q9if\" data-testid=\"richTextElement\" data-angle=\"0\" data-angle-style-location=\"style\" data-screen-in-hide=\"done\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 10px; background: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; pointer-events: none; overflow-wrap: break-word; min-height: var(--min-height); position: relative; left: 7px; grid-area: 2 / 1 / 3 / 2; place-self: start; width: 125px; height: auto; visibility: inherit;\"><h2 class=\"font_2\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; line-height: 1.1em; font-size: 14px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; pointer-events: auto;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-family: wfont_187882_649f0e5b62244282b24915c10061d950, wf_649f0e5b62244282b24915c10, orig_circular_std_book;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; letter-spacing: 0em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><font color=\"#000000\">Definition et </font></span></span></span></span>description</h2></div><p><span style=\"color: rgb(0, 0, 0); background-color: transparent; font-family: wfont_187882_649f0e5b62244282b24915c10061d950, wf_649f0e5b62244282b24915c10, orig_circular_std_book; font-size: 15px;\">La création et la conception de site web ou web design est la conception de l’interface web : l’architecture interactionnelle, l’organisation des pages, l’arborescence et la navigation dans un site web. La conception d’un design web tient compte des contraintes spécifiques du support Internet, notamment en termes d’ergonomie, d’utilisabilité et d’accessibilité.</span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: wfont_187882_649f0e5b62244282b24915c10061d950, wf_649f0e5b62244282b24915c10, orig_circular_std_book; font-size: 15px;\">Le webdesign, c’est aussi du marketing. N’oubliez jamais que votre site web est un outil de marketing primordial. Il représente votre marque, votre produit et son fonctionnement.</span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: wfont_187882_649f0e5b62244282b24915c10061d950, wf_649f0e5b62244282b24915c10, orig_circular_std_book; font-size: 15px;\"><br></span></p><div id=\"comp-ku578eh4\" class=\"_1Q9if\" data-testid=\"richTextElement\" data-angle=\"0\" data-angle-style-location=\"style\" data-screen-in-hide=\"done\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 10px; background: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; pointer-events: none; overflow-wrap: break-word; min-height: var(--min-height); position: relative; left: 0px; grid-area: 1 / 1 / 2 / 2; place-self: start; width: 282px; height: auto; visibility: inherit;\"><h2 class=\"font_2\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; line-height: 1.1em; font-size: 33px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; pointer-events: auto;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; letter-spacing: 0em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: b