 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; pointer-events: auto; font-size: 21px; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><font color=\"#e79439\">Objectif : séduire les futurs utilisateurs du site.</font></span></span></p><p class=\"font_8\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; pointer-events: auto; font-size: 21px; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><font color=\"#e79439\"><br></font></span></span><span style=\"color: rgb(0, 0, 0); background-color: transparent; font-size: 15px; letter-spacing: 0em;\">Le web designer est novateur, curieux, méthodique et organisé, le web designer sait travailler en équipe et souvent sous pression.</span></p><div><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><div id=\"comp-ku57by4t\" class=\"_1Q9if\" data-testid=\"richTextElement\" data-angle=\"0\" data-angle-style-location=\"style\" data-screen-in-hide=\"done\" style=\"margin: 0px 0px 8px calc((100% - 980px) * 0.5); padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; pointer-events: none; overflow-wrap: break-word; min-height: var(--min-height); position: relative; left: 16px; grid-area: 5 / 1 / 6 / 2; place-self: start; width: 686px; height: auto