INSERT INTO `notification_templates` VALUES (2,'New badge','<p>Congratulations! You received [u.b.title]&nbsp;badge.</p>'),(3,'Your user group changed','<p>Your user group changed to [u.g.title] .</p>'),(4,'Your class created','<p>Your class [c.title] successfully created. It will be published after approval.</p>'),(5,'Your class approved','<p>Your class [c.title] successfully approved. Now you can find it on the website.</p>'),(6,'Your class rejected','<p>Sorry, Your class [c.title] rejected because it doesn\'t meet requirements or is against the community rules.</p>'),(7,'New comment for your class','<p>[u.name] left a new comment on your class [c.title] .</p>'),(8,'New class support message','<p>user [u.name] send new support message for course with title [c.title] .</p>'),(9,'New reply on support conversation','<p>New reply on a support conversation on your class [c.title] support.</p>'),(10,'New support ticket','<p>New support ticket received with subject [s.t.title] .</p>'),(11,'New reply on support ticket','<p>The support ticket with the subject [s.t.title] updated with a new reply.</p>'),(12,'New financial document','<p>&nbsp;New financial document submitted for your class [c.title] with type [f.d.type] and amount [amount] .</p>'),(13,'New payout request','<p>New payout request received with the amount [payout.amount] . You can manage it using the admin panel.</p>'),(14,'Payout has been processed','Your payout has been processed with the amount [payout.amount]&nbsp;&nbsp;to your account [payout.account] .'),(15,'New sales','<p>Congratulations! There is a new sales for your class [c.title] .</p>'),(16,'New purchase completed','<p>The class [c.title] successfully purchased. Now you can start learning.</p>'),(17,'New feedback','<p>Your class [c.title] received a [rate.count] stars rating from [student.name] .</p>'),(18,'Offline payment submitted','<p>An offline payment request with the amount [amount] submitted successfully.</p>'),(19,'Offline payment approved','<p>Offline payment request with the amount [amount] successfully approved.</p>'),(20,'Offline payment rejected','<p>Sorry, offline payment request with the amount [amount]&nbsp;rejected.</p>'),(21,'Subscription plan activated','<p>[s.p.name] subscription package activated by user [u.name] .</p>'),(22,'New meeting request','<p>New meeting booked by [u.name] for [time.date] with the amount [amount] .</p>'),(23,'New meeting join URL','<p>The reserved meeting join URL created by [instructor.name]. Join the meeting on [time.date] using this URL: [link] .</p>'),(24,'Meeting reminder','<p>You have a meeting on [time.date] . Don\'t forget to join it on time.</p>'),(25,'Meeting finished','<p>The meeting finished. Instructor: [instructor.name] Student:&nbsp; [student.name]&nbsp; Meeting time: [time.date] .</p>'),(26,'New contact message','<p>New contact message with title [c.u.title] received from [u.name] .</p>'),(27,'Live class reminder','<p>Your live class [c.title] will be conducted on [time.date] . Join it on time.</p>'),(28,'Promotion plan activated','<p>Promotion plan [p.p.name]&nbsp;&nbsp;activated for the call [c.title] .</p>'),(29,'Promotion plan purchased','<p>There is new request for activating [p.p.name] for class [c.title] .&nbsp;</p>'),(30,'New certificate','<p>You achieved a new certificate for [c.title] . You can download it from the class page or your panel.</p>'),(31,'New pending quiz','<p>[student.name] passed [q.title] quiz of the [c.title] class and waiting for correction to get results.</p>'),(32,'Waiting quiz result','<p>Your pending quiz corrected and your result is [q.result] for [q.title] quiz of [c.title] class.</p>'),(33,'New comment','<p>[u.name] left a new comment and waiting for approval.</p>'),(34,'Payout request submitted','<p>Your payout request successfully submitted for [payout.amount] . You will receive an email when processed.</p>');
